import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      icon: 'fas fa-code',
      title: 'Frontend Development',
      skills: ['React', 'Vue.js', 'Angular', 'JavaScript', 'TypeScript', 'HTML5', 'CSS3', 'SASS']
    },
    {
      icon: 'fas fa-server',
      title: 'Backend Development',
      skills: ['Node.js', 'Python', 'Java', 'Express.js', 'Django', 'Spring Boot', 'REST APIs', 'GraphQL']
    },
    {
      icon: 'fas fa-database',
      title: 'Database & Cloud',
      skills: ['MongoDB', 'PostgreSQL', 'MySQL', 'AWS', 'Azure', 'Docker', 'Kubernetes', 'Redis']
    },
    {
      icon: 'fas fa-mobile-alt',
      title: 'Mobile Development',
      skills: ['React Native', 'Flutter', 'iOS', 'Android', 'Swift', 'Kotlin']
    },
    {
      icon: 'fas fa-palette',
      title: 'Design & Tools',
      skills: ['Figma', 'Adobe XD', 'Sketch', 'Git', 'Jira', 'Agile', 'Scrum']
    },
    {
      icon: 'fas fa-chart-line',
      title: 'Data & Analytics',
      skills: ['Python', 'R', 'SQL', 'Tableau', 'Power BI', 'Machine Learning']
    }
  ];

  return (
    <section id="skills" className="section skills">
      <div className="container">
        <h2 className="section-title">Skills & Technologies</h2>
        <div className="section-content">
          <p style={{ fontSize: '1.1rem', color: '#6b7280', marginBottom: '2rem' }}>
            I work with a wide range of technologies and tools to deliver high-quality solutions
          </p>
          <div className="skills-grid">
            {skillCategories.map((category, index) => (
              <div key={index} className="skill-card">
                <div className="skill-icon">
                  <i className={category.icon}></i>
                </div>
                <h3 className="skill-title">{category.title}</h3>
                <ul className="skill-list">
                  {category.skills.map((skill, skillIndex) => (
                    <li key={skillIndex}>{skill}</li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
